import React, { useContext } from 'react';
import { Navbar, Container, Button } from 'react-bootstrap';
import logo from '../../resource/logo-white.png';
import AppContext from '../../context/appContext';
import Perfil from './Perfil';

const Bar = (props) => {
	const { token, setLogout } = useContext(AppContext);

	if (!token) return null;
  return (
    <Navbar bg="primary" variant="dark">
	    <Container>
		  <Navbar.Brand>
			  <img alt="" src={logo} width="30" height="30"
		        className="d-inline-block align-top mr-3" />
		  	<b className="text-uppercase">ACE Soluciones y Proyectos Inmobiliarios S.A. DE C.V.</b>
		  </Navbar.Brand>
		  <Navbar.Toggle />
		  <Navbar.Collapse className="justify-content-end">
		    <Navbar.Text>
		      <Button onClick={setLogout} variant="outline-light">
		      	Cerrar Sesi√≥n
		      </Button>
		    </Navbar.Text>
		  </Navbar.Collapse>
		</Container>
	</Navbar>
  )
}

export default Bar;
